import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';
import { 
  Upload, 
  BarChart3, 
  TrendingUp, 
  Zap, 
  Shield, 
  Globe, 
  ChevronDown,
  Play,
  Facebook,
  Linkedin,
  Chrome
} from 'lucide-react';
import './App.css';

// Animated Background Component
const AnimatedBackground = () => {
  return (
    <div className="animated-background">
      <div className="floating-shapes">
        {[...Array(20)].map((_, i) => (
          <motion.div
            key={i}
            className="floating-shape"
            animate={{
              y: [0, -100, 0],
              x: [0, Math.random() * 100 - 50, 0],
              rotate: [0, 360],
            }}
            transition={{
              duration: Math.random() * 10 + 10,
              repeat: Infinity,
              ease: "linear",
              delay: Math.random() * 5,
            }}
            style={{
              left: `${Math.random() * 100}%`,
              animationDelay: `${Math.random() * 5}s`,
            }}
          />
        ))}
      </div>
    </div>
  );
};

// Hero Section
const HeroSection = () => {
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    setIsVisible(true);
  }, []);

  return (
    <section className="hero-section">
      <AnimatedBackground />
      <div className="hero-content">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: isVisible ? 1 : 0, y: isVisible ? 0 : 50 }}
          transition={{ duration: 1, delay: 0.2 }}
          className="hero-text"
        >
          <motion.h1
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="hero-title"
          >
            AdPulse
            <span className="gradient-text"> Analytics</span>
          </motion.h1>
          <motion.p
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
            className="hero-subtitle"
          >
            Transform your ad data into actionable insights with AI-powered analytics
          </motion.p>
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, delay: 0.8 }}
            className="hero-buttons"
          >
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="cta-button primary"
            >
              <Upload size={20} />
              Upload CSV
            </motion.button>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="cta-button secondary"
            >
              <Play size={20} />
              Watch Demo
            </motion.button>
          </motion.div>
        </motion.div>

        <motion.div
          initial={{ opacity: 0, x: 50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 1, delay: 1 }}
          className="hero-visual"
        >
          <div className="floating-card">
            <div className="card-header">
              <div className="platform-icons">
                <Facebook className="platform-icon" />
                <Linkedin className="platform-icon" />
                <Chrome className="platform-icon" />
              </div>
            </div>
            <div className="card-content">
              <div className="data-visualization">
                <div className="chart-bar" style={{ height: '60%' }}></div>
                <div className="chart-bar" style={{ height: '80%' }}></div>
                <div className="chart-bar" style={{ height: '40%' }}></div>
                <div className="chart-bar" style={{ height: '90%' }}></div>
                <div className="chart-bar" style={{ height: '70%' }}></div>
              </div>
            </div>
          </div>
        </motion.div>
      </div>

      <motion.div
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1, delay: 1.5 }}
        className="scroll-indicator"
      >
        <motion.div
          animate={{ y: [0, 10, 0] }}
          transition={{ duration: 2, repeat: Infinity }}
        >
          <ChevronDown size={24} />
        </motion.div>
      </motion.div>
    </section>
  );
};

// Features Section
const FeaturesSection = () => {
  const features = [
    {
      icon: <Upload size={32} />,
      title: "Smart Data Ingestion",
      description: "Automatically recognizes and organizes your ad data regardless of column naming conventions.",
      color: "#4F46E5"
    },
    {
      icon: <BarChart3 size={32} />,
      title: "Advanced Analytics",
      description: "Comprehensive analysis of impressions, clicks, conversions, and ROI across all platforms.",
      color: "#06B6D4"
    },
    {
      icon: <TrendingUp size={32} />,
      title: "Performance Insights",
      description: "Identify trends, patterns, and optimization opportunities with AI-powered recommendations.",
      color: "#10B981"
    },
    {
      icon: <Zap size={32} />,
      title: "Real-time Processing",
      description: "Instant analysis and reporting with lightning-fast processing capabilities.",
      color: "#F59E0B"
    },
    {
      icon: <Shield size={32} />,
      title: "Secure & Private",
      description: "Your data never leaves your control with enterprise-grade security measures.",
      color: "#EF4444"
    },
    {
      icon: <Globe size={32} />,
      title: "Multi-Platform Support",
      description: "Seamlessly analyze data from Meta, Google, and LinkedIn ad platforms.",
      color: "#8B5CF6"
    }
  ];

  return (
    <section className="features-section">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
        className="section-header"
      >
        <h2>How It Works</h2>
        <p>Transform your ad data into actionable insights in three simple steps</p>
      </motion.div>

      <div className="features-grid">
        {features.map((feature, index) => (
          <motion.div
            key={index}
            initial={{ opacity: 0, y: 50 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: index * 0.1 }}
            viewport={{ once: true }}
            className="feature-card"
            whileHover={{ 
              scale: 1.05,
              boxShadow: "0 20px 40px rgba(135, 206, 235, 0.2)"
            }}
          >
            <div 
              className="feature-icon"
              style={{ backgroundColor: feature.color }}
            >
              {feature.icon}
            </div>
            <h3>{feature.title}</h3>
            <p>{feature.description}</p>
          </motion.div>
        ))}
      </div>
    </section>
  );
};

// Platform Support Section
const PlatformSection = () => {
  const platforms = [
    {
      name: "Meta/Facebook Ads",
      icon: <Facebook size={48} />,
      dataPoints: [
        "impressions | reach | impr",
        "clicks | link_clicks",
        "spend | amount_spent",
        "conversions | website_purchases | leads",
        "conversion_value | website_purchase_value",
        "date | day",
        "campaign_name | adset_name | ad_name"
      ]
    },
    {
      name: "Google Ads",
      icon: <Chrome size={48} />,
      dataPoints: [
        "impressions",
        "clicks",
        "cost | spend",
        "conversions | all_conversions",
        "conversion_value | all_conversion_value",
        "date | day",
        "campaign | campaign_name | ad_group_name"
      ]
    },
    {
      name: "LinkedIn Campaign Manager",
      icon: <Linkedin size={48} />,
      dataPoints: [
        "impressions",
        "clicks",
        "spend | cost_in_local_currency",
        "conversions",
        "total_conversion_value",
        "date",
        "campaign_name"
      ]
    }
  ];

  return (
    <section className="platform-section">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
        className="section-header"
      >
        <h2>Supported Platforms</h2>
        <p>Comprehensive support for all major advertising platforms</p>
      </motion.div>

      <div className="platforms-grid">
        {platforms.map((platform, index) => (
          <motion.div
            key={index}
            initial={{ opacity: 0, x: index % 2 === 0 ? -50 : 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: index * 0.2 }}
            viewport={{ once: true }}
            className="platform-card"
            whileHover={{ 
              scale: 1.02,
              boxShadow: "0 20px 40px rgba(135, 206, 235, 0.15)"
            }}
          >
            <div className="platform-header">
              <div className="platform-icon">
                {platform.icon}
              </div>
              <h3>{platform.name}</h3>
            </div>
            <div className="data-points">
              <h4>Supported Data Points:</h4>
              <ul>
                {platform.dataPoints.map((point, idx) => (
                  <li key={idx}>{point}</li>
                ))}
              </ul>
            </div>
          </motion.div>
        ))}
      </div>
    </section>
  );
};

// Demo Section
const DemoSection = () => {
  return (
    <section className="demo-section">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
        className="section-header"
      >
        <h2>See It In Action</h2>
        <p>Watch how AdPulse transforms your raw data into actionable insights</p>
      </motion.div>

      <motion.div
        initial={{ opacity: 0, scale: 0.9 }}
        whileInView={{ opacity: 1, scale: 1 }}
        transition={{ duration: 1 }}
        viewport={{ once: true }}
        className="demo-container"
      >
        <div className="demo-video-placeholder">
          <div className="video-overlay">
            <motion.button
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.9 }}
              className="play-button"
            >
              <Play size={48} />
            </motion.button>
            <p>Click to watch demo</p>
          </div>
        </div>
      </motion.div>
    </section>
  );
};

// CTA Section
const CTASection = () => {
  return (
    <section className="cta-section">
      <motion.div
        initial={{ opacity: 0, y: 50 }}
        whileInView={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        viewport={{ once: true }}
        className="cta-content"
      >
        <h2>Ready to Transform Your Ad Analytics?</h2>
        <p>Upload your CSV file and get instant insights in minutes</p>
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          className="cta-button primary large"
        >
          <Upload size={24} />
          Start Analyzing Now
        </motion.button>
      </motion.div>
    </section>
  );
};

// Main App Component
function App() {
  return (
    <div className="App">
      <HeroSection />
      <FeaturesSection />
      <PlatformSection />
      <DemoSection />
      <CTASection />
    </div>
  );
}

export default App;
